#!/usr/bin/env bash

set -euo pipefail

addValidator1=""
addValidator2=""
addValidator3=""
addValidator4=""
addValidator5=""

createSubnet=""

createChain=""


addValidators=($addValidator1 $addValidator2 $addValidator3 $addValidator4 $addValidator5)

curl -X POST --data '{
    "jsonrpc": "2.0",
    "method": "platform.issueTx",
    "params": {
        "tx":"'${createSubnet}'",
        "encoding": "hex"
    },
    "id": 1
}' -H 'content-type:application/json;' 127.0.0.1:9650/ext/bc/P


sleep 1

for v in "${addValidators[@]}"; do
  curl -X POST --data '{
      "jsonrpc": "2.0",
      "method": "platform.issueTx",
      "params": {
          "tx":"'${v}'",
          "encoding": "hex"
      },
      "id": 1
  }' -H 'content-type:application/json;' 127.0.0.1:9650/ext/bc/P
  sleep 3
done

sleep 3


curl -X POST --data '{
    "jsonrpc": "2.0",
    "method": "platform.issueTx",
    "params": {
        "tx":"'${createChain}'",
        "encoding": "hex"
    },
    "id": 1
}' -H 'content-type:application/json;' 127.0.0.1:9650/ext/bc/P


